const Country = (props) => {

    const CountryFlagStyle = {
        minWidth: 200,
        minHeight: 200,
        border: '1px solid rgba(0, 0, 0, 0.05)', 
      }

      const CountryNameStyle = {
        color: 'green',
        fontStyle: 'italic',
        fontSize: 16,
      }



    return(
        <>
        <h2 style={CountryNameStyle}>country: {props.country.name.common}</h2>
        <p>Capital: {props.country.capital}</p>
        <p>Area: {props.country.area}</p>
        <h2>languages:</h2>
        <ul>
            {props.country.languages 
            ? Object.values(props.country.languages).map(i => <li>{i}</li>)
            : null}
        </ul> 
        <div alt='flag' style={CountryFlagStyle}>{props.country.flag}</div>
        </>
    )
}
export default Country
